// IE fix function - Detect IE broswer in order to work around scaling issues with SVGs.
// http://stackoverflow.com/questions/29141337/is-it-possible-to-detect-all-versions-of-ie-with-javascript-how
var isIE;
(function detectIE() {
    var ua = window.navigator.userAgent,
        msie = ua.indexOf('MSIE '),
        trident = ua.indexOf('Trident/'),
        edge = ua.indexOf('Edge/');
    if (msie > 0 || trident > 0 || edge > 0) {
        isIE = true;
    } else {
        isIE = false;
    }
})();

// IE fix function - scale SVG by setting the style to the target SVG dynamically
function fixSvgScaleIE(ratio) {
    var svgLoader = document.getElementById("svg-loader"),
        newWidth = svgLoader.offsetWidth,
        newHeight = newWidth / ratio,
        svgEl = document.getElementById("svg");
    svgEl.style.width = newWidth + "px";
    svgEl.style.height = newHeight + "px";
}

// IE fix function - Return the displayed SVG viewbox ratio
function getSvgRatio(isLandscape) {
    return isLandscape ? (725 / 325) : (600 / 625);
}




window.onload = function() {

        // Threshold in pixels to switch svg version
    var targetWidth = 550,
        // Get the SVG version to display: "landscape" or "portrait"
        isLandscape = getSvgOrientation(window.innerWidth, targetWidth),
        svgLoader = document.getElementById("svg-loader"),
        svgHeroEl = document.getElementById("svg");

        // IE fix
    var svgRatio;
        if (isIE) {
            // IE svg scale fix. - Identify the displayed SVG viewbox ratio
            svgRatio = getSvgRatio(isLandscape);
        }

    // Load the correct SVG version and run the animation
    (function() {
        loadSVG(window.innerWidth, targetWidth);
        // IE svg scale fix
        if (isIE) {
            fixSvgScaleIE(svgRatio);
        }
        svgAnimInit(isLandscape);
    }());

    // Window Resize Handling
    // https://developer.mozilla.org/en-US/docs/Web/Events/resize
    (function() {

        window.addEventListener("resize", resizeThrottler, false);
        var resizeTimeout;

        function resizeThrottler() {
            // ignore resize events as long as an actualResizeHandler execution is in the queue
            if (!resizeTimeout) {
                resizeTimeout = setTimeout(function() {
                    resizeTimeout = null;
                    actualResizeHandler();
                    // The actualResizeHandler will execute at a rate of 15fps
                }, 66);
            }
        }

        function actualResizeHandler() {

            // IE svg scale fix on window resize
            if (isIE) {
                fixSvgScaleIE(svgRatio);
            }

            // Reload new SVG and animation on window width threshold
            var wWidth = window.innerWidth;
            if (loadSVG(wWidth, targetWidth)) {
                svgLoader.classList.add("is-loading");
                isLandscape = getSvgOrientation(wWidth, targetWidth);
                // IE svg scale fix in SVG version change
                if (isIE) {
                    svgRatio = getSvgRatio(isLandscape);
                    fixSvgScaleIE(svgRatio);
                }
                svgAnimInit(isLandscape);
            }
        }

    }()); // Window Resize Handling END

} // window.onload END




